import React, { useState } from "react";
import "./styles/nav.css";

const Nav = () => {
  const [isOpen, setIsOpen] = useState(false);

  const openNav = () => {
    setIsOpen(true);
  };

  const closeNav = () => {
    setIsOpen(false);
  };

  return (
    <>
      <div className={`sidenav ${isOpen ? "open" : ""}`}>
        <a href="javascript:void(0)" className="closebtn" onClick={closeNav}>
          &times;
        </a>
        <a href="#">About</a>
        <a href="#">Services</a>
        <a href="#">Clients</a>
        <a href="#">Contact</a>
      </div>
      <span onClick={openNav} className="card">
        Menu
      </span>
    </>
  );
};

export default Nav;
